import React from "react"

import Friend from "./Friend"
//import Pet from "./Pet"
import friendsList from "./friendsList"

function App() {
    const rolladex = friendsList.map(function (individual) {
        return (
            <Friend name={individual.name} age={individual.age} />
        )
    })

    return (
        <div>
            {rolladex}
        </div>
    )

}

export default App
